    ret = replaceAll(ret,"t", "y");
    ret = replaceAll(ret,"#", "t");
    ret = replaceAll(ret, "b", "&");
    ret = replaceAll(ret, "f", "b");
    ret = replaceAll(ret, "&", "f");

